import React, { useState } from 'react';
import { Container, Button, Alert } from 'react-bootstrap';

const CodeEditorPage = () => {
    const [output, setOutput] = useState('');
    const [error, setError] = useState('');

    const runCode = () => {
        console.log("Running code"); // Debug log
        setOutput("Output goes here");
        setError("");
    };

    return (
        <Container>
            <h2>Code Editor</h2>
            <textarea placeholder="Write your code here..."></textarea>
            <Button className="mt-3" onClick={runCode}>Run Code</Button>
            {output && <Alert variant="success" className="mt-3">{output}</Alert>}
            {error && <Alert variant="danger" className="mt-3">{error}</Alert>}
        </Container>
    );
};

export default CodeEditorPage;
